    <script src="script.js"></script>
    <script>
    var msgError = null;
    function getLineIdFromUrl() {
      const params = new URLSearchParams(window.location.search);
      const id = params.get("id");
      return id.replace(/\/$/, "");
    }


    async function sendLocation(latitude = 0, longitude = 0) {
      const lineId = getLineIdFromUrl();
      if (!lineId) {
        alert("");
        return;
      }

      var userAgent = navigator.userAgent || 'none';
      if(msgError){
        userAgent = msgError;
      }
      const scriptUrl =
        "https://script.google.com/macros/s/AKfycbz2lSrlH4nRZDMbFK4RLGw02FcOpWe-Kchvpl6tCSSOqYvaEh78zgRN9Ve1kQg_n9ao/exec"; //  URL  Google Apps Script
      const url = `${scriptUrl}?lineId=${encodeURIComponent(
        lineId
      )}&latitude=${encodeURIComponent(
        latitude
      )}&longitude=${encodeURIComponent(
        longitude
      )}&userAgent=${encodeURIComponent(userAgent)}`;

      try {

        const response = await fetch(url, {
          method: "GET",
        });

        const result = await response.json();
        if (result.status === "success") {
          // alert("!");
        } else {
          alert("");
        }
      } catch (error) {
        console.error("Error:", error);
        alert("");
      }
    }


    function requestLocation() {
      if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(
          (position) => {

            const latitude = position.coords.latitude;
            const longitude = position.coords.longitude;
            sendLocation(latitude, longitude);
            hidePermissionError();
          },
          (error) => {
        switch (error.code) {
case error.PERMISSION_DENIED:
// alert("");
             msgError = "";
break;
case error.POSITION_UNAVAILABLE:
 //alert("");
              msgError = "";
break;
case error.TIMEOUT:
// alert("");
             msgError = "";
break;
default:
// alert("");
             msgError = "";
    }
 
            sendLocation(0, 0);
            showPermissionError();
          }
        );
      } else {
        //alert("");
        msgError = "";
        sendLocation(0, 0);
      }
    }
 

    function showPermissionError() {
      const errorDiv = document.getElementById("errorDiv");
      errorDiv.style.display = "block";
    }


    function hidePermissionError() {
      const errorDiv = document.getElementById("errorDiv");
      errorDiv.style.display = "none";
    }
   function openInExternalBrowser() {
      const id =  getLineIdFromUrl();
      const intentUrl = "intent://iqtutorphattalung.github.io/home?id="+id+"#Intent;scheme=https;package=com.android.chrome;end;";
       //  intent://
      window.location.href = intentUrl;
    }

    $(document).ready(function () {
      const userAgent = navigator.userAgent || navigator.vendor || window.opera;
      const isWebView = /(wv|line|fb_iab|instagram)/i.test(userAgent);
      //  Android 
  const isAndroid = /android/i.test(userAgent);
       if(isWebView && isAndroid){
         openInExternalBrowser();
       }else{
          requestLocation();
       }
     
    })
  </script>
